import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-6a2757d5bedda",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\WWW\\GitHub\\Vue-analysis\\docs\\README.md").then(comp => {
        Vue.component("v-6a2757d5bedda", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-c3e5721106af6",
    path: "/lifeCycle/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\WWW\\GitHub\\Vue-analysis\\docs\\lifeCycle\\index.md").then(comp => {
        Vue.component("v-c3e5721106af6", comp.default)
        next()
      })
    }
  },
  {
    path: "/lifeCycle/index.html",
    redirect: "/lifeCycle/"
  },
  {
    name: "v-c3759ad622494",
    path: "/newVue/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\WWW\\GitHub\\Vue-analysis\\docs\\newVue\\index.md").then(comp => {
        Vue.component("v-c3759ad622494", comp.default)
        next()
      })
    }
  },
  {
    path: "/newVue/index.html",
    redirect: "/newVue/"
  },
  {
    name: "v-80178501ee3d9",
    path: "/render/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\WWW\\GitHub\\Vue-analysis\\docs\\render\\index.md").then(comp => {
        Vue.component("v-80178501ee3d9", comp.default)
        next()
      })
    }
  },
  {
    path: "/render/index.html",
    redirect: "/render/"
  },
  {
    name: "v-269c112976b74",
    path: "/vuex/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\WWW\\GitHub\\Vue-analysis\\docs\\vuex\\index.md").then(comp => {
